import React from "react";
import s from "./header.module.css";

const Header = () => {
  return (
    <header className={s.header}>
      <a href="#" className={s.logo}>

      </a>

      <nav className={s.navbar}>
        <a href="#">Home</a>
        <a href="#">About</a>
        <a href="#">Educations</a>
        <a href="#">Skills</a>
        <a href="#">Contacts</a>
      </nav>
    </header>
  );
};

export default Header;
